INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (101111, 11, 10, 16112, "うわあ！　マスターってば\n絵も上手なんですね！　でも\n言い方がお婆ちゃんみたいですよ？\nなるほど、これが亀の甲羅で逃避行！", 0, 16112023, 0, 1, 1, 0.5);
