INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (100911, 11, 10, 16612, "ふふ、やった！　やったぞ！\nまたしても傑作の完成だ！\nみんなの努力が実る、この瞬間……\n何度やっても達成感があるな！", 0, 16612026, 0, 1, 1, 0.5);
