INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (105111, 11, 10, 16612, "まったくもう……\nみんなして絵の具まみれじゃない。\nって、あら？　この赤いのは……", 0, 16612041, 0, 1, 1, 0.5);
