INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (105611, 11, 10, 16612, "ふふ、そういうアンタも、\nほっぺに絵の具がついてるじゃないか。\nほら、きれいにしてやるから\nそこに並びな、アンタたち。", 0, 16612046, 0, 1, 1, 0.5);
