INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (102711, 11, 10, 18812, "クスクス……違います。\nこれはあのおかたへの愛……\n枯れることのない、永遠の愛が\nテーマですわ……", 0, 18812036, 0, 1, 1, 0.5);
