INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (104911, 11, 10, 25212, "よし、なかなか上手く描けたよ。\nでも、弟くんへの愛を表すには\nまだちょっと足りなかったかなあ？", 0, 25212018, 0, 1, 1, 0.5);
