INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (101111, 11, 10, 25212, "そういうのは今はいいですから！\nでもお姉ちゃん美人で頭良くて強いのに\n絵までうまいんですねえ……\nまさに文句上等？　ってやつですよ。", 0, 25212023, 0, 1, 1, 0.5);
