INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (100511, 11, 10, 28412, "これでバッチリッス！\nどうッスか？\nトラタイガーみたいにかっこよく\n描けてるんじゃないッスかね？", 0, 28412022, 0, 1, 1, 0.5);
