INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (104711, 11, 10, 28412, "クリスちゃんは相変わらずだね。\nでも、描き直したおかげで\nさらに良い絵になったと思うよ。\n私も鎧に絵の具がはねなくて一安心だ。", 0, 28412037, 0, 1, 1, 0.5);
